s.aL(0,"Raycasting",new A.ba3(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/raycast_example.dart","In this example the raycast functionality is showcased. The circle moves around\nand casts 10 rays and checks how far the nearest hitboxes are and naively moves\naround trying not to hit them.\n  ")
s.aL(0,"Raytracing",new A.ba4(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/raytrace_example.dart","In this example the raytrace functionality is showcased.\nClick to start sending out a ray which will bounce around to visualize how it\nworks. If you move the mouse around the canvas, rays and their reflections will\nbe moved rendered and if you click again some more objects that the rays can\nbounce on will appear.\n  ")
s.aL(0,"Raycasting Max Distance",new A.ba5(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/raycast_max_distance_example.dart","This examples showcases how raycast APIs can be used to detect hits within certain range.\n")
